import Button from '@material-ui/core/Button'

function End()
{
    const res = localStorage.getItem("last");
    return (
		<div className="loose">
			<h1>{(res === "win" ? "You Win!" : "You loose..." )}</h1>
			<Button onClick={() => this.startGame()} block>
			Retry?
			</Button>
            <Button onClick={() => window.location = "/menu"} block>
			Return to Menu
			</Button>
		</div>);
}
export default End;
